import React from 'react'
import { usePropertiesQuery } from '../../generated/graphql'
import { Typography, Grid, Button } from '@material-ui/core';

interface Props {
    selectPropListener: any
}


export const PropertyList:  React.FC<Props> = (Props) => {
    const {data, loading, error} = usePropertiesQuery();


    if(loading){
        return <div>
            loading ....
        </div>
    }

    if(error){
        console.log(error)
        return <div>err</div>
    }

    if(!data){
        return <div>
            no data
        </div>
    }

    return (
        <div>
            <Typography variant="h6">
                Gartenh√§user
            </Typography>
            <ul>
                {data.allProperties?.map((x) => {
                    <div>
                        <li key={x.id}>
                            <Grid>
                                {x.id}
                                {x.location}
                                <Button onClick={Props.selectPropListener(x)}>
                                Buchen
                                </Button>
                            </Grid>
                        </li>
                    </div>
                })}
            </ul>
        </div>
    )

}
